import React, {useEffect} from 'react';
import {sessionStore} from "@entities/session";
import { HeaderSkeleton } from './HeaderSkeleton';
import {userStore} from "@entities/user";

export const Header = () => {
    const user = userStore.useUser();

    useEffect(() => {
       userStore.getMe();
    }, []);

    if(!user) {
        return <HeaderSkeleton />
    }

    return (
        <div>
            Хейдер загружен
        </div>
    );
};
